import React from 'react';
import './App.css';
function hello() {
  function formatName(user) {
    return user.firstName + ' ' + user.lastName;
  }

  const user = {
    firstName: 'Harper',
    lastName: 'Perez'
  };

  return <h1>Hello, {formatName(user)}!</h1>;
}
export default hello;
